// SPDX-License-Identifier: MIT
pragma solidity 0.8.0;

contract Voting {
    address public owner;
    uint public electionId;

    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    struct Election {
        uint id;
        string name;
        string description;
        uint startTime;
        uint endTime;
        bool isActive;
        mapping(uint => Candidate) candidates;
        uint candidatesCount;
        mapping(address => bool) voters;
    }

    mapping(uint => Election) public elections;
    uint public electionsCount;

    event ElectionCreated(uint electionId, string name, uint startTime, uint endTime);
    event Voted(uint electionId, uint candidateId, address voter);
    event CandidateAdded(uint electionId, uint candidateId, string name);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }

    modifier validElection(uint _electionId) {
        require(_electionId > 0 && _electionId <= electionsCount, "Invalid election ID");
        _;
    }

    constructor() {
        owner = msg.sender;
        electionsCount = 0;
    }

    function createElection(
        string memory _name,
        string memory _description,
        uint _startTime,
        uint _endTime
    ) public onlyOwner {
        require(_startTime < _endTime, "Start time must be before end time");
        require(_startTime > block.timestamp, "Start time must be in the future");

        electionsCount++;
        electionId = electionsCount;

        Election storage e = elections[electionId];
        e.id = electionId;
        e.name = _name;
        e.description = _description;
        e.startTime = _startTime;
        e.endTime = _endTime;
        e.isActive = true;
        e.candidatesCount = 0;

        emit ElectionCreated(electionId, _name, _startTime, _endTime);
    }

    function addCandidate(uint _electionId, string memory _name)
        public
        onlyOwner
        validElection(_electionId)
    {
        Election storage e = elections[_electionId];
        require(block.timestamp < e.startTime, "Cannot add candidates after election has started");

        e.candidatesCount++;
        e.candidates[e.candidatesCount] = Candidate(e.candidatesCount, _name, 0);

        emit CandidateAdded(_electionId, e.candidatesCount, _name);
    }

    function vote(uint _electionId, uint _candidateId)
        public
        validElection(_electionId)
    {
        Election storage e = elections[_electionId];
        require(e.isActive, "Election is not active");
        require(block.timestamp >= e.startTime, "Election has not started yet");
        require(block.timestamp <= e.endTime, "Election has ended");
        require(!e.voters[msg.sender], "You have already voted in this election");
        require(_candidateId > 0 && _candidateId <= e.candidatesCount, "Invalid candidate ID");

        e.voters[msg.sender] = true;
        e.candidates[_candidateId].voteCount++;

        emit Voted(_electionId, _candidateId, msg.sender);
    }

    function getElectionResults(uint _electionId)
        public
        view
        validElection(_electionId)
        returns (uint[] memory, uint[] memory)
    {
        Election storage e = elections[_electionId];
        require(block.timestamp > e.endTime, "Election has not ended yet");

        uint[] memory candidateIds = new uint[](e.candidatesCount);
        uint[] memory voteCounts = new uint[](e.candidatesCount);

        for (uint i = 1; i <= e.candidatesCount; i++) {
            candidateIds[i-1] = e.candidates[i].id;
            voteCounts[i-1] = e.candidates[i].voteCount;
        }

        return (candidateIds, voteCounts);
    }

    function getElectionDetails(uint _electionId)
        public
        view
        validElection(_electionId)
        returns (
            uint id,
            string memory name,
            string memory description,
            uint startTime,
            uint endTime,
            bool isActive,
            uint candidatesCount
        )
    {
        Election storage e = elections[_electionId];
        return (
            e.id,
            e.name,
            e.description,
            e.startTime,
            e.endTime,
            e.isActive,
            e.candidatesCount
        );
    }

    function getCandidateDetails(uint _electionId, uint _candidateId)
        public
        view
        validElection(_electionId)
        returns (uint id, string memory name, uint voteCount)
    {
        require(_candidateId > 0 && _candidateId <= elections[_electionId].candidatesCount, "Invalid candidate ID");

        Candidate storage c = elections[_electionId].candidates[_candidateId];
        return (c.id, c.name, c.voteCount);
    }

    function hasVoted(uint _electionId, address _voter)
        public
        view
        validElection(_electionId)
        returns (bool)
    {
        return elections[_electionId].voters[_voter];
    }
}
